How can I retrieve data on the safety, accessibility, comfort, and health benefits of walking or taking public transportation for a daily commute from the following JSON file in my C# application?
[JSON data]
{
  "transportation": {
    "walking": {
      "safety": "low accident rates",
      "accessibility": "pedestrian-friendly city",
      "comfort": "pleasant weather and scenery",
      "health_benefits": "improved cardiovascular health and weight loss"
    },
    "public_transportation": {
      "safety": "reliable and well-maintained vehicles",
      "accessibility": "extensive network of routes and stops",
      "comfort": "air conditioning and comfortable seating",
      "health_benefits": "less stress and reduced risk of heart disease"
    }
  }
}
[C# code]
using System;
using System.IO;
using Newtonsoft.Json.Linq;
namespace TransportDataRetrieval
{
    class Program
    {
        static void Main(string[] args)
        {
            string jsonString = File.ReadAllText(@"C:\path\to\json\file.json");
            JObject transportData = JObject.Parse(jsonString);

            Console.WriteLine("Which type of transportation data would you like to retrieve?");
            string transportType = Console.ReadLine();
            Console.WriteLine("Which aspect of the transportation data would you like to retrieve?");
            string aspect = Console.ReadLine();
            string data = transportData.SelectToken($"transportation.{transportType}.{aspect}").ToString();
            Console.WriteLine($"The {aspect} of {transportType} transportation is: {data}");
        }
    }
}

